
function ConferenceViewModel() {
  var self = this;
  self.conf = ko.observable(new Conference({
    name: 'Test Conference 1',
    topic: 'Test Topic 1',
    imageUrl: 'data:image/svg+xml;base64,'
  }));

  self.venueTemplateToUse = function(venue) {
    return venue ? "no-venue-template" : "venue-template";
  }

  console.log(self.conf());
}

$(function() {
  ko.applyBindings(new ConferenceViewModel());
});
